import React, { Component } from 'react'

class Home extends Component {
    render() {
        return(
            <div>
                <h1>Welcome to my site!</h1>
                <p>I am a video game developer, currently working on my third game, Prodrome.</p>
                <p>In order to get a myriad of experience under my belt, I prefer for the moment to work as a one-man dev team, which means I do all the programming, design, sound, animations, etc. It's exhausting work, but fun.</p>
            </div>
        )
    }
}

export default Home
